def fvol_pax_armChain():
	V000 = inpax_armChain_end1
	V001 = V000.fuse(inpax_armChain_end2)
	V002 = V001.fuse(inpax_armChain_bone0)
	V003 = V002.fuse(inpax_armChain_bone1)
	V004 = V003.fuse(inpax_armChain_bone2)
	V005 = V004.fuse(inpax_armChain_bone3)
	VFC = V005.removeSplitter()
	return VFC
